const makeAuto = (type, name = -1, options = {}) => {
    let turret = {
        type: exports.autoTurret,
        size: 10,
        independent: true,
        angle: 180,
        x: 0,
        color: 16,
        layer: 1,
        rot: 361
    };
    if (turret.type.COLOR != null) turret.color = turret.type.COLOR;
    if (options.type != null) turret.type = options.type;
    if (options.size != null) turret.size = options.size;
    if (options.independent != null) turret.independent = options.independent;
    if (options.angle != null) turret.angle = options.angle;
    if (options.x != null) turret.x = options.x;
    if (options.color != null) turret.color = options.color;
    if (options.layer != null) turret.layer = options.layer;
    if (options.rot != null) turret.rot = options.rot;
    let output = JSON.parse(JSON.stringify(type)),
        gun = {
            POSITION: [turret.size, turret.x, 0, turret.angle, turret.rot, turret.layer],
            TYPE: [turret.type, {
                CONTROLLERS: ['nearestDifferentMaster'],
                INDEPENDENT: turret.independent,
                COLOR: turret.color
            }]
        };
    if (type.GUNS != null) output.GUNS = type.GUNS;
    if (type.DANGER != null) output.DANGER = type.DANGER >= 7 ? type.DANGER : type.DANGER + 1;
    output.TURRETS = type.TURRETS == null ? [gun] : [...type.TURRETS, gun];
    output.LABEL = name === -1 ? 'Auto-' + type.LABEL : name;
    return output;
};
